import "./IntakeFormLayout.scss";

import {Col, Container, Row, Visible} from "react-grid-system";
import {ImageConfig} from "../../constants";
import React, {useCallback} from "react";
import ProgressBarComponent from "../../shared/components/core/progress-bar/ProgressBarComponent";
import {LeftArrow} from "../../constants/ImageConfig";

export interface IntakeFormLayoutComponentProps {
    posterImagePath: any;
    formMainTitle?: string;
    toolTipInfo?: any;
    progressInfo?: any;
    onBackNavigation?: () => void;
}

const IntakeFormLayoutComponent = (props: React.PropsWithChildren<IntakeFormLayoutComponentProps>) => {

    const {posterImagePath, onBackNavigation, formMainTitle, toolTipInfo, progressInfo, children} = props;

    const handleBackNavClick = useCallback(() => {
        if (onBackNavigation) {
            onBackNavigation();
        }
    }, [onBackNavigation]);

    const renderFormBranding = useCallback(() => {
        return <div className="intake-form-branding">
            <div className="intake-form-back-navigation-wrapper">
                {onBackNavigation && <div className="intake-form-back-navigation" onClick={handleBackNavClick}>
                    <LeftArrow className="intake-form-back-navigation-icon" alt="nav-back-icon"/>
                    <span className="intake-form-back-navigation-label">Back</span>
                </div>}
            </div>
            <div className="intake-form-branding-logo">
                <img src={ImageConfig.sdiLogo} alt="sdilogo"/>
            </div>
        </div>
    }, [onBackNavigation, handleBackNavClick]);

    return (
        <div className="intake-form-layout-component">
            <Row>
                <Col sm={12} md={12} lg={6} className="intake-form-poster-meta-wrapper">
                    <Visible xs sm md>
                        {renderFormBranding()}
                    </Visible>
                    <Visible lg xl xxl xxxl>
                        {posterImagePath && <div className="intake-form-poster-image">
                            <img src={posterImagePath} alt={posterImagePath}/>
                        </div>}

                        {formMainTitle && <div className="intake-form-main-title">
                            {formMainTitle}
                        </div>}
                        {toolTipInfo && <div className="intake-form-tooltip-info">
                            <div dangerouslySetInnerHTML={{__html: toolTipInfo}}/>
                        </div>}

                        <div className="intake-form-progress-bar-wrapper">
                            {progressInfo?.progress && <div className="intake-form-progress-bar">
                                {<ProgressBarComponent
                                    progress={progressInfo?.progress}
                                    progressIcon={progressInfo?.icon}
                                    progressTitle={progressInfo?.title}
                                    progressDescription={progressInfo?.description}
                                />}
                            </div>}
                        </div>
                    </Visible>


                    <Visible xs sm md>
                        <Row>
                            <Col xs={4} sm={4}>
                                {posterImagePath && <div className="intake-form-poster-image">
                                    <img src={posterImagePath} alt={posterImagePath}/>
                                </div>}
                            </Col>

                            <Col xs={6} sm={6} className="pdd-0">
                                {formMainTitle && <div className="intake-form-main-title">
                                    {formMainTitle}
                                </div>}
                                {toolTipInfo && <div className="intake-form-tooltip-info">
                                    <div dangerouslySetInnerHTML={{__html: toolTipInfo}}/>
                                </div>}
                            </Col>
                            <Col xs={2} sm={2}></Col>

                            <div className="intake-form-progress-bar-wrapper">
                                {progressInfo?.progress && <div className="intake-form-progress-bar">
                                    {<ProgressBarComponent
                                        progress={progressInfo?.progress}
                                        progressIcon={progressInfo?.icon}
                                        progressTitle={progressInfo?.title}
                                        progressDescription={progressInfo?.description}
                                    />}
                                </div>}
                            </div>
                        </Row>
                    </Visible>
                </Col>
                <Col sm={12} md={12} lg={6} className={'intake-form-wrapper'}>
                    <Visible lg xl xxl xxxl>
                        {renderFormBranding()}
                    </Visible>
                    <div className={"intake-form-body"}>
                        <Container>
                            <Row>
                                <Col sm={1.5}></Col>
                                <Col sm={9}>
                                    {children}
                                </Col>
                                <Col sm={1.5}></Col>
                            </Row>
                        </Container>
                    </div>
                </Col>
            </Row>
        </div>
    );

};

export default IntakeFormLayoutComponent;


